// frontend/src/components/AssetListPanel.js
import React, { useEffect } from 'react';

const AssetListPanel = ({ savedAssets }) => {
  useEffect(() => {
    console.log("Rendering saved assets:", savedAssets); // Debugging: log saved assets on render
  }, [savedAssets]);

  return (
    <div className="asset-list-panel">
      <h2>Saved Assets</h2>
      <ul>
        {savedAssets.map((asset, index) => (
          // Fallback for debugging: "Unnamed Asset" if selectedAsset is undefined
          <li key={index}>
            {index + 1}. {asset.selectedAsset || "Unnamed Asset"}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AssetListPanel;
